import Navbar from "./Navbar";
import NewsFeedItem from "./NewsFeedItem";
import styles from "./Layout.module.css";

const newsFeedItemList = [
  { src: "./tiger.jpg", title: "Tiger" },
  { src: "./turtle.jpg", title: "Turtle" },
  { src: "./sambar-deer.jpg", title: "Samber Deer" },
  { src: "./squirrel.jpg", title: "Squrrel" },
  { src: "./pupy.jpg", title: "Pupy" },
];
export const siteTitle = "Demo App";

const Layout = ({ children, home }) => (
  <div>
    <Navbar />

    {home
      ? newsFeedItemList.map((item, key) => {
          return (
            <div className={styles.topClearance}>
              <NewsFeedItem key={key} detail={item} />
            </div>
          );
        })
      : ""}
  </div>
);

export default Layout;
